import React from 'react'

const UserList = ({data}) => {
  return (
    <div style={{margin: "100px auto", width: "100px"}}>
        {data.map((user)=> {
            return <ul>
                <li>{user.username}({user.age})</li>
            </ul>
        })}
    </div>
  )
}

export default UserList
